    axios.get(`http://localhost:8080/api/bookings/student/${userId}`)
      .then(res => {
        setBookings(res.data);
      })
      .catch(err => console.error("Error fetching bookings:", err));
  }, [userId]);

  return (
    <div className="min-h-screen bg-gray-50 p-6">
      <div className="container mx-auto max-w-4xl">
        
        <div className="flex justify-between items-center mb-6">
          <h1 className="text-3xl font-bold text-gray-800">üìÖ ‡∏ï‡∏≤‡∏£‡∏≤‡∏á‡πÄ‡∏£‡∏µ‡∏¢‡∏ô‡∏Ç‡∏≠‡∏á‡∏â‡∏±‡∏ô</h1>
          <button 
            onClick={() => navigate('/student-home')}
            className="text-blue-600 hover:underline"
          >
            ‚Üê ‡∏Å‡∏•‡∏±‡∏ö‡∏´‡∏ô‡πâ‡∏≤‡∏Ñ‡πâ‡∏ô‡∏´‡∏≤
          </button>
        </div>

        <div className="bg-white rounded-lg shadow-md p-6">
          {bookings.length === 0 ? (
            <p className="text-center text-gray-500 py-10">‡∏Ñ‡∏∏‡∏ì‡∏¢‡∏±‡∏á‡πÑ‡∏°‡πà‡∏°‡∏µ‡∏Å‡∏≤‡∏£‡∏à‡∏≠‡∏á‡∏Ñ‡∏≠‡∏£‡πå‡∏™‡πÄ‡∏£‡∏µ‡∏¢‡∏ô</p>
          ) : (
            <div className="space-y-4">
              {bookings.map((booking) => (
                <div key={booking.id} className="border-b pb-4 last:border-b-0 flex justify-between items-center">
                  <div>
