                       ‡∏ß‡∏¥‡∏ä‡∏≤: {booking.slot?.tutor?.subjects?.[0]?.name || "‡∏ß‡∏¥‡∏ä‡∏≤‡∏ó‡∏±‡πà‡∏ß‡πÑ‡∏õ"}
                    </h3>
                    <p className="text-gray-700">
                      ‡∏Ñ‡∏£‡∏π‡∏ú‡∏π‡πâ‡∏™‡∏≠‡∏ô: <span className="font-semibold">{booking.tutor?.username}</span>
                    </p>
                    <p className="text-gray-600 text-sm mt-1">
                      ‡πÄ‡∏ß‡∏•‡∏≤‡πÄ‡∏£‡∏µ‡∏¢‡∏ô: {new Date(booking.slot?.startTime).toLocaleString('th-TH')} 
                      {' - '}
